const SKYPE_CALL_DURATION="skype-call-duration";function displayResultsAsTable(e,t){console.time("test");let n=document.getElementById(t).getElementsByTagName("tbody")[0];e.forEach(e=>{let t="<tr><td>"+e.date.toLocaleDateString("en-GB")+'</td><td class="'+SKYPE_CALL_DURATION+'">'+secondsToHms(e.duration)+'</td><td style="display:inline-grid;"><span>'+e.participentOne+"</span><br><span>"+e.participentTwo+"</span></td><td>"+e.whoStartedCall+'</td><td><input type="checkbox" class="table-remove-row-checkbox"></td></tr>';n.insertRow(n.rows.length).innerHTML=t}),document.getElementById("skype-display-table").classList.remove("hidden"),console.timeEnd("test")}function secondsToHms(e){e=Number(e);let t=Math.floor(e/3600),n=Math.floor(e%3600/60),o=Math.floor(e%3600%60);return(t>0?t+"h ":"")+(n>0?n+"m ":"")+(o>0?o+"s ":"")}function populateCallRemoval(e,t){let n=document.getElementById(t);e.forEach(e=>{let t=document.createElement("option");t.value=e,t.innerHTML=e,n.appendChild(t)})}function populateHiddenField(e,t){document.getElementById(t).value=e}
